import React from 'react';
import Card from './Card/Card';
import ChildCard from './ChildCard/ChildCard'
import {ReactComponent as ReactSkills} from './skills.svg';


class App extends React.Component{
  render(){
    return(
      <Card>
        <ReactSkills/>
        <ChildCard/>
      </Card>
    )
  }
}

export default App;
